  render() {
    return (
      <Container>
        <Row>
          <Col>
            <h1>&#127804; Daily's</h1>
          </Col>
        </Row>
        <Row>
          <Col>
            <h3>
              today's date: <span>xx-xx-xxxx</span>
            </h3>
          </Col>
        </Row>
      </Container>
    );
  }
}

export default Heading;
